import React from 'react';
import { Paper, Typography } from '@material-ui/core';

const StyledCard = ({ rocketName, type, details, location, launchDate }) => {
  return (
      <React.Fragment>
        <Paper elevation={1}>
            <div><h3><strong>Rocket Name: </strong>{rocketName}</h3></div>
            <div><Typography color="textSecondary"><strong>Type: </strong>{type}</Typography></div>
            <div><strong>Details: </strong>{details}</div>
            <div><strong>Location: </strong>{location}</div>
            <div><strong>Launch Date: </strong>{launchDate}</div>
        </Paper>
    </React.Fragment>
  )
}

export default StyledCard;
